import React from 'react';
import axios from 'axios';
import {generatePath, Link} from 'react-router-dom';
class AnalyzeData extends React.Component{
    state={
        clinicalData:[]
    }
    componentDidMount(){
        axios.get("http://localhost:8080/clinicalservices/api/patients/analyze/"+this.props.match.params.patientId).then(res=>{
            
            this.setState(res.data);
        })

    }
    render(){
        function sortByDate(a, b) {
            if (a.measuredDateTime < b.measuredDateTime) {
                return 1;
            }
            if (a.measuredDateTime > b.measuredDateTime) {
                return -1;
            }
            return 0;
        }
        const sorted = this.state.clinicalData.sort(sortByDate);
        console.log(sorted)
        return (<div>
            <h2>Patient Details:</h2>
            First Name: {this.state.firstName} &nbsp;
            Last Name: {this.state.lastName} &nbsp;
            Age: {this.state.age}
            <h2>Clinical Report:</h2>
            {this.state.clinicalData.map(eachEntry=><TableCreator item={eachEntry} patientId={this.state.id} key={eachEntry.id} />)}


        </div>)
    }
}

class TableCreator extends React.Component{
    render(){
        var eachEntry = this.props.item;
        var patientId = this.props.patientId;
        return <div>
            <table>
                <tbody>
                <tr><td><b>{eachEntry.componentName}</b></td></tr>
                <tr>
                    <td>{eachEntry.componentName}</td>
                    <td>{eachEntry.componentValue}</td>
                    <td>{eachEntry.measuredDateTime}</td>
                    <td>
                        <Link to ={"/chart/"+eachEntry.componentName+"/"+patientId}><img src={process.env.PUBLIC_URL + '/Picture.png'} width="20" height="15"/></Link>
                    </td>
                    
                </tr>
                </tbody>
            </table>
        </div>
    }
}

export default AnalyzeData;
